import FrostAPI from "./network/api";
import { FrostError } from "./common/error";

(new FrostAPI()).signUp('musoftware', 'musoftware@daum.net', 'unexpected8090!', 'MU').then((api: FrostAPI) => {
    console.log(api.userID);
}).catch((reason: FrostError) => {
    console.log(reason);
    console.log(reason.debugMessage);
});
(new FrostAPI()).signIn('musoftware', 'unexpected8090').then((api: FrostAPI) => {
    console.log(api.userID);
}).catch((reason: FrostError) => {
    console.log(reason);
    console.log(reason.debugMessage);
});

const TEST_VAR = '1';
const TEST_VAR2 = 123;
const TEST_VAR3 = 123;

export { TEST_VAR, TEST_VAR2,TEST_VAR3 };
